Movie Info: Besharam is a 2013 Bollywood romantic action comedy film directed by Abhinav Kashyap. The film features Ranbir Kapoor opposite Pallavi Sharda, who marks her return to cinema. Filming for Besharam was scheduled to commence on December 10, 2012, with part of it taking place on a film set in Film City, Mumbai. The film's tagline is &quot;Na sammaan ka moh, na apmaan ka bhay&quot;, translated as &quot;No yearning for respect, no fear of humiliation&quot;.

